import React from "react";
import Card from "../UI/Card";
import ChartBar from "./ChartBar";
import "./Chart.css";

const Chart = (props) => {
  return (
    <div className="chart">
      <Card>
        {props.dataPoints.map((dataPoint) => (
          <ChartBar
            key={dataPoint.label}
            value={dataPoint.value}
            maxValue={null}
          />
        ))}
      </Card>
    </div>
  );
};

export default Chart;
